import React from 'react';
import "../css/cadr.css";
const Partneri = () => {
    return ( 
        <div className="partneri">
            <h1>Партнери</h1>
          <p>Имаш идеја? Отворени сме за соработка</p>
          <div>
          <button className="kopcinja blackBtn">
            <span>
              <i class="fa fa-arrow-right" aria-hidden="true"></i>
            </span>{" "}
            ВИДИ ГО ПРОСТОРОТ
          </button>
        </div>
        </div>
     );
}
 
export default Partneri;
